import Link from 'next/link';

const NavBar=()=>{
  return(
    <div className='bg-gray-500 py-4'>
      <Link href='./sobre'>Sobre</Link>
      <Link href='./cadastro'>Cadastre-se</Link>
      <Link href='./login'>Sobre</Link>
      Cadastre-se 
      Entrar 
    </div>
  );
}

export default NavBar;
